bio:
Where the mind is without fear and the head is held high;
Where knowledge is free-

Into that heaven of freedom, my Father, let my country awake...

full_text:
Adm Dinesh K Tripathi #CNS, on an official visit to #Bangladesh, called on Sheikh Hasina,  Prime Minister of Bangladesh on July 2nd. 

During discussions, the Bangladesh PM recalled &amp; appreciated #India's contribution to Bangladesh’s War of Liberation in 1971.

